script: |
  super -f text -I q4639.spq | sort > q4639.out

inputs:
  - name: q4639.spq
    data: |
      SELECT DISTINCT col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - ( - 10 ) IN ( - col2 / col2 * - col1 + + col2 * col1 + - col2 / col0 );
  - name: tab0

outputs:
  - name: q4639.out
    data: |
      1
      21
      81
